import {React, Component} from 'react'
import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom';
import app from './components/app'
import NavBar from './NavBar';
class App extends Component {
  render(){
  return (
    <>
    <div>
    <NavBar/>
   <Router>
     <Route path="/" component={app} exact/>
   </Router>
   </div>
   </>
  );}
}

export default App;
